    console.log(`${image}`)
    const i = './assets/project_nxtgame@3x.png'
    const getImage = (ur) => {
        return require(`${ur}`)
    }
    return (
        <div className ="item-wrapper" style={{
            backgroundColor,
            padding : '3em',
        }}>
            <div id="image-wrapper"><img alt={image} src={getImage(image)}></img></div>
        </div>

    )

}
